&quot;,&quot;## Is it possible to be connected and spontaneous in adulthood?\\n\\n&gt; *Over the years, I’ve made lots of friends: childhood friends, work friends, college friends, writer friends. I have friends who like to hike, and friends who like to chat over coffee and friends who live far away but whom I talk to a few times a year. But close friends? ‘Friends’ level friends? The “I can tell you anything and count on you always” kind of friends? Not so much. A childhood friend and I had a falling-out, never to be repaired. Another close friend moved away. In groups of adults, you often hear some form of this complaint: It’s hard to make friends as an adult. And if, for whatever reason, you don’t stay connected to your childhood or college friends, you can end up in your 30s (or 40s, or 50s) knowing a lot of people, but being close to very few of them.\\n— [the New York Times](https://www.nytimes.com/2019/11/20/smarter-living/how-to-have-closer-friendships.html)*\\n&gt; \\n\\n&gt; “*Why should it require explicit scheduling to see a friend who lives ‘within striking distance’? Why shouldn’t proximity do some of the work? The answer, for many Americans, is that anything beyond a few blocks away might as well be miles; it all requires a car. We do not encounter one another in cars.”\\n— [How Our Housing Choices Make Adult Friendships More Difficult](https://www.vox.com/2015/10/28/9622920/housing-adult-friendship)*\\n&gt; \\n\\n**For most Americans, when we marry and start families, we atomize, and our friendships, like our taste in music, freeze where they were when we were young and single.** We shouldn’t just accept a way of living that makes interactions with neighbors and friends a burden that requires special planning.&quot;,536946089]],[&quot;^17&quot;,[24438,&quot;^P&quot;,&quot;^19&quot;,536946089]],[&quot;^17&quot;,[24438,&quot;^X&quot;,2,536946089]],[&quot;^17&quot;,[24438,&quot;^F&quot;,22140,536946089]],[&quot;^17&quot;,[24438,&quot;^T&quot;,[],5369460       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
